          <h6 className='fs-h3'>Themes Options</h6>
        </div>

        <div className='filters'>
          <select id='themes-options' name='theme-option'>
            <option>Blue</option>
            <option>Orange</option>
          </select>
        </div>
      </div>
    </>
  );
};

export default ThemesOptions;
